import React from 'react';
import styled from 'styled-components';

const ChattingLogsBlock = styled.div`
  width: 100%;
  border: 1px solid #732bff;
  flex: 6;
`;

const ChattingLogs = ({ logs }) => {
  return (
    <ChattingLogsBlock>
      {logs.map((message, idx) => (
        <div key={idx}>{message.message}</div>
      ))}
    </ChattingLogsBlock>
  );
};

export default ChattingLogs;
